import React, { Component, Fragment } from "react";
import listOfWebSites from "./listOfWebSites";
import Select from "react-select";

export default class websitesDropDown extends Component {
  constructor() {
    super();
    this.state = {
      isClearable: true,
      isSearchable: true
    };
  }
  render() {
    const { isClearable, isSearchable } = this.state;
    return (
      <Fragment>
        <Select
          className="basic-single"
          classNamePrefix="select"
          isClearable={isClearable}
          isSearchable={isSearchable}
          options={listOfWebSites}
        />
      </Fragment>
    );
  }
}
